import { Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import Movies from "./components/movies/Movies";
import NavBar from "./components/NavBar";
import TvShows from "./components/tvMenu/TvShows";
import Actors from "./components/actors/Actors";
import MovieDetails from "./components/movies/MovieDetails";
import MovieFullCast from "./components/movies/MovieFullCast";
import TvDetails from "./components/tvMenu/TvDetails";
import MovieReview from "./components/movies/MovieReview";
import TvFullCast from "./components/tvMenu/TvFullCast";
import TvReview from "./components/tvMenu/TvReview";

function App() {
  return (
    <div>
      <NavBar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/movie" element={<Movies />} />
        <Route path="/tvshows" element={<TvShows />} />
        <Route path="/actors" element={<Actors />} />
        <Route path="/movie/:id" element={<MovieDetails />} />
        <Route path="/movie/:id/cast" element={<MovieFullCast />} />
        <Route path="/movie/:id/review" element={<MovieReview />} />
        <Route path="/tvshows/:id" element={<TvDetails />} />
        <Route path="/tvshows/:id/cast" element={<TvFullCast />} />
        <Route path="/tvshows/:id/review" element={<TvReview />} />
      </Routes>
    </div>
  );
}

export default App;
